svg.script:
var delay_between = 10000; // change it to control delay in between states;
var delay_end = 1000; //  change it to control delay in between animations;
var speed = 30 // change it to control the speed of animation. The bigger vallue -> the slower speed;
var frame = 1;
var frames = 120;
var itr = 0;

function $(sel) { return document.querySelector(sel); }

function move() {

for (i=1; i<=frames; i++) {
  $("#a" + i).setAttribute("style", "");
}

$("#a" + frame).setAttribute("style", "visibility:visible");

if (frame < frames) {
    frame++;
  } else {
    itr++;
    frame= 1;
  }

  if (frame != 60 && frame != 120) {
      setTimeout(function(){
        requestAnimationFrame(move);
      },  speed);
  }
  if (frame == 60) {
      setTimeout(function(){
        requestAnimationFrame(move);
      },  delay_between);
  }
  if (frame == 120) {
      setTimeout(function(){
        requestAnimationFrame(move);
      },  delay_end);
  }

};

window.addEventListener('DOMContentLoaded', () => {
  move(); // call this function to start animation;
});
